import { Link } from 'react-router-dom';
import './Navbar.css';
const Navbar = () => {
    return (
        <header className="navbar">
            <Link to="/">
                {/* logo */}
                <h2>modXchange</h2>  
            </Link>
            <Link to="/exchange">
                <p>Post new exchange</p>
            </Link>
        </header>
    )
}

export default Navbar;
